// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; 
import Home from './components/Home'; // Correct if the file is named Home.js (capital H)
// src/index.js or src/App.js
import 'bootstrap/dist/css/bootstrap.min.css';
import Header from './components/reuse/Header';  // Import Header
import Login from './components/Login.js';



function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />  {/* Show Home component at the root route */}
        {/* Add more routes here for other pages, like login, registration, etc. */}
        <Route path="/login" element={<Login />} />
      </Routes>
    </Router>
  );
}


export default App;
